import{_ as e,o as a,c as o,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 59.1-92.10 Cancellation.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-92.10.md","filePath":"vacode/59.1-92.10.md"}'),i={name:"vacode/59.1-92.10.md"},r=t('<h1 id="§-59-1-92-10-cancellation" tabindex="-1">§ 59.1-92.10 Cancellation. <a class="header-anchor" href="#§-59-1-92-10-cancellation" aria-label="Permalink to &quot;§ 59.1-92.10 Cancellation.&quot;">​</a></h1><p>A. The Commission shall cancel, in whole or in part:</p><ol><li><p>Any registration concerning which the Commission receives a voluntary request for cancellation thereof from the registrant or the assignee of record;</p></li><li><p>Any registration granted under this chapter or prior law and not renewed in accordance with the provisions hereof; or</p></li><li><p>Any registration concerning which the Commission finds on its own motion, or on petition of any person who alleges that he is or will be damaged by such registration, that:</p></li></ol><p>a. The registered mark has been abandoned;</p><p>b. The registrant is not the owner of the mark;</p><p>c. The registration was granted as a result of a clerical error;</p><p>d. The registration was obtained fraudulently;</p><p>e. The mark is or has become the generic name for the goods or services, or a portion thereof, for which it has been registered; or</p><p>f. There is a substantial likelihood of confusion with a mark or trade name previously used in this Commonwealth by another and not abandoned.</p><p>B. The Commission may also cause a partial cancellation of a registration by requiring the registrant to amend the registration to adopt a narrower identification of goods or services than is identified in the original certificate.</p><p>C. Before the Commission cancels or partially cancels any registration under subdivision A 3, the Commission shall give reasonable notice and an opportunity to be heard to the registrant and to other persons known to have or claim an interest in the mark.</p><p>1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0819" target="_blank" rel="noreferrer">819</a>.</p>',12),n=[r];function s(c,l,h,d,p,m){return a(),o("div",null,n)}const _=e(i,[["render",s]]);export{g as __pageData,_ as default};
